class Effects{constructor(){console.log("Effects running")}randomOffset(t,r){return t+random(-r,r)}randomZeroOne(){return random(0,1)}randomProb(){return this.randomZeroOne()>.5}givenProb(t){return this.randomZeroOne()>t}fuzzyValue(t){return this.randomProb()?this.randomOffset(t,10):random(t)}randomShaped(t,r){return color(random(t,r),random(t,r),random(t,r))}randomColor(){return this.randomShaped(0,255)}randomPastelColor(){return this.randomShaped(155,255)}randomDarkColor(){return this.randomShaped(0,90)}shadedColor(t){const r=this.randomOffset(red(t),10),e=this.randomOffset(green(t),10),o=this.randomOffset(blue(t),10);return color(r,e,o)}shadedColorOff(t,r){const e=this.randomOffset(red(t),r),o=this.randomOffset(green(t),r),h=this.randomOffset(blue(t),r);return color(e,o,h)}randomPalette(t,r){const e=[t];for(let t=1;t<r;t+=1)e[t]=this.randomColor();return e}relatedPalette(t,r){const e=[t];for(let o=1;o<r;o+=1)e[o]=this.shadedColorOff(t,50);return e}grid2d(t){const r=[];for(let e=0;e<t.width;e+=1){const o=[];for(let r=0;r<t.height;r+=1)o.push(t.get(e,r));r.push(o)}return r}gridToBuffer(t,r){const e=createGraphics(t.width,t.height);e.loadPixels();for(let t=0;t<e.width;t+=1)for(let o=0;o<e.height;o+=1)e.set(t,o,r[t][o]);return e.updatePixels(),e}stripes(t,r){const e=createGraphics(t,t);for(let t=0;t<e.width;t+=1){const o=r[floor(map(t,0,e.width,0,r.length))],h=this.randomProb()?o:random(r);e.stroke(this.shadedColor(h)),e.line(t,0,t,e.height)}return e}dots(t,r){const e=createGraphics(t,t);e.background(random(r)),e.noStroke();for(let o=0;o<t;o+=1)e.fill(this.shadedColor(random(r))),e.circle(random(e.width),random(e.height),random(.3*t));return e}randomBlurX(t){const r=createGraphics(t.width,t.height),e=t.get();r.loadPixels();for(let o=0;o<t.width;o+=1)for(let h=0;h<t.height;h+=1){const t=e.get(floor(random(h)),o);r.set(h,o,t)}return r.updatePixels(),r}fuzzyBlurX(t){const r=createGraphics(t.width,t.height),e=t.get();r.loadPixels();for(let o=0;o<t.width;o+=1)for(let h=0;h<t.height;h+=1){const t=e.get(this.fuzzyValue(o),h);r.set(o,h,t)}return r.updatePixels(),r}mosaic(t){const r=createGraphics(t.width,t.height),e=t.get();r.noStroke();const o=t.width/100;for(let h=0;h<t.width;h+=o)for(let n=0;n<t.height;n+=o){const t=e.get(h,n);r.fill(t),r.rect(h,n,o,o)}return r}shiftedPixels(t){const r=createGraphics(t.width,t.height),e=this.grid2d(t);for(let t=0;t<r.width;t+=1){const o=floor(random(.5*r.width)),h=[],n=e[t].length;for(let r=n-o;r<n;r+=1)h.push(e[t][r]);for(let r=o;r<n-o;r+=1)h.push(e[t][r]);for(let r=0;r<o;r+=1)h.push(e[t][r]);e[t]=this.randomProb()?h.sort():h}return this.gridToBuffer(r,e)}randomLight(t){return t.pointLight(255,255,255,random(.5*-t.width,.5*t.width),random(.5*-t.height,.5*t.height),random(.5*-t.width,.5*t.width))}randomColoredLight(t,r){return t.pointLight(red(r),green(r),blue(r),random(.5*-t.width,.5*t.width),random(.5*-t.height,.5*t.height),random(.5*-t.width,.5*t.width))}grainMask(t,r){const e=t.get(),o=createGraphics(t.width,t.height);for(let t=0;t<o.width;t+=1)for(let e=0;e<o.height;e+=1)this.givenProb(r)&&o.point(t,e);return e.mask(o.get()),e}linesMask(t,r){const e=t.get(),o=createGraphics(t.width,t.height);for(let t=0;t<o.height;t+=1)this.givenProb(r)&&o.line(0,t,o.width,t);return e.mask(o.get()),e}}
